import React from 'react';
import Menu from './Menu';
import Navbar from './Navbar'
import Cart from './Cart';
import { useEffect } from 'react';
import { closeMenu } from '../utilities/closeMenu';


function Ecommerce() {
  useEffect(() => closeMenu())
  const imgStyle = {
    position: 'absolute',
    left: '0',
    objectFit: 'cover',
    zIndex: '-1'
  }

  return (
    <>
      <img style={imgStyle} src="https://cdn.shopify.com/s/files/1/0818/5227/files/HP_RaysRocking_2000x.jpg?v=1683640772" alt="home-page-cover" />
      <Menu></Menu>
      <div className='page-container'>
        <Navbar></Navbar>
        <div className='outlet'></div>
      </div>
      <Cart></Cart>
    </>
  );
}

export default Ecommerce
